import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import {NavigationContainer} from '@react-navigation/native';
import {createBottomTabNavigator} from '@react-navigation/bottom-tabs';
import {WebView} from 'react-native-webview';


const Tab = createBottomTabNavigator();



export default function App() {
  return (
    <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name="React" component={RN}></Tab.Screen>
        <Tab.Screen name="Java" component={Java}></Tab.Screen>
        <Tab.Screen name="PHP" component={PHP}></Tab.Screen>
        <Tab.Screen name="JavaScript" component={JS}></Tab.Screen>
      </Tab.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});

function RN(){
  return(
  <WebView source={{uri:'https://prefeiturasrc.mg.gov.br/docs/Documentos/Decretos/2021/Decreto_468-2021.pdf'}}></WebView>
  );
}

function Java(){
  return(
  <WebView style={{flex:1}} javaScriptEnabled={true} source={{uri:'https://youtu.be/lID9kEd6Pdc'}}></WebView>
  );
}

function PHP(){
  return(
    <WebView style={{flex:1}} javaScriptEnabled={true} source={{html:"<html><body><iframe width='800' height='400' src='https://youtu.be/aQXEftUhtM8?t=192' frameboder='0' allowfullscreen></iframe></body></html>"}}></WebView>
  );
}

function JS(){
  return(
    <WebView stule={{flex:1}} javaScriptEnabled={true} source={{uri:''}} ></WebView>
  );
}
